import React from "react";
import mealsImg from '../../assets/meals.jpeg';
import classes from './Header.module.css';

const Header = props => {
    return 
    <React.Fragment>
        <header className={classes.header}>
            <h1>React Food</h1>
            <button>Cart</button>
        </header>
        <div className={classes['main-image']}>
            <img src={mealsImg} />
        </div>
    </React.Fragment>
};

export default Header;
